B.B4=new A.mG("Soy egresado de la Licenciatura en F\xedsica en la Universidad de Los Andes (ULA), particip\xe9 de la 2da. cohorte de LA-CoNGA physics y actualmente soy estudiante de la Maestr\xeda en F\xedsica en la Universidad Sim\xf3n Bol\xedvar (USB) en Venezuela. Mi \xe1rea de estudio es f\xedsica de altas energ\xedas experimental y ciencia de datos. Tengo habilidades en programaci\xf3n en C++ y Python, reproducibilidad cient\xedfica, manejo herramientas de edici\xf3n multimedia y nociones en dise\xf1o web. Particip\xe9 en el hackathon CoAfina 2022, una experiencia maravillosa que me permiti\xf3 colaborar con otros estudiantes de Am\xe9rica Latina para encontrar soluciones innovadoras a retos cient\xedficos y educativos usando datos abiertos. Es un placer formar parte de esta nueva edici\xf3n y espero seguir compartiendo y aprendiendo con todos ustedes.","https://ve.linkedin.com/in/altuos/","Oscar Altuve","assets/group/altuos.jpg",null)
B.B5=new A.mG("Estudiante de Ingenier\xeda de Sistemas de la Universidad Industrial de Santander. Durante mi etapa de estudiante me ha interesado el campo del Aprendizaje de M\xe1quina. Es por esto que cuento con conocimientos sobre implementaci\xf3n de algoritmos de aprendizaje profundo en python, usando librerias de tensorflow y pytorch. Tambi\xe9n tengo conocimientos en herramientas de tratamiento de datos cient\xedficos como numpy y Pandas, as\xed como tambi\xe9n en su an\xe1lisis en forma de gr\xe1ficas con librerias como matplotlib. Adem\xe1s de manejar muy bien python como lenguaje de programaci\xf3n, tambi\xe9n puedo programar en otros lenguajes como Java, C++, Matlab, y en lenguajes de gesti\xf3n de base de datos como SQL.","https://www.linkedin.com/in/geison-alfredo-blanco-rodriguez-861b17249","Geison Blanco","assets/group/geison.jpg",null)
